import React from 'react';
import './Partner.css';

const logos = [
  { id: 1, src: 'metro.png', alt: 'Metro' },
  { id: 2, src: 'triangle.png', alt: 'AECOM' },
  { id: 3, src: 'aecom.png', alt: 'AECOM' },
  { id: 4, src: 'blokur.png', alt: 'Blokur' },
  { id: 5, src: 'beuth.png', alt: 'Beuth' },
  { id: 5, src: 'fire.png', alt: 'fire' },
  // Add more logos here
];

const Partner = () => {
  return (
    <div className="logo-gallery">
      {logos.map((logo) => (
        <div key={logo.id} className="logo-item">
          <img src={logo.src} alt={logo.alt} className="logo" />
        </div>
      ))}
    </div>
  );
};

export default Partner;
